import React from 'react';
import { Link } from 'react-router-dom';

function Home() {
  return (
    <div className="home">
      <h1>Course Walkthrough</h1>
      <p>Explore the journey from Lab 1 to Lab 7!</p>
      <Link to="/lab/1">
        <button>Start Walkthrough</button>
      </Link>
    </div>
  );
}

export default Home;
